public class CacheHitRate {
    public static void main(String[] args) {
        SparkSession spark = SparkSession.builder()
                .appName("CacheHitRate")
                .master("local[*]")
                .getOrCreate();

        // Load your data
        Dataset<Row> onsiteAttributedData = spark.read().parquet("path/to/your/data");
