        Dataset<Row> withCacheHit = joinedData.withColumn("cacheHit", when(col("query").isin(joinedData.select("query").distinct().collectAsList()), true).otherwise(false));

        // Calculate the hit rate
        Dataset<Row> hitRate = withCacheHit.groupBy("cacheHit").agg(count("*").as("count"), countDistinct("query").as("distinctQueries"));
        hitRate.show();

        spark.stop();
    }
}
```

