```
import React, { createContext, useContext, useState, useEffect } from 'react';

const TooltipContext = createContext();

export const TooltipProvider = ({ children }) => {
  const [tooltip, setTooltip] = useState(null);

  const openTooltip = (id) => {
    setTooltip(id);
  };

  const closeTooltip = (id) => {
    setTooltip(null);
  };

  return (
    <TooltipContext.Provider value={{ openTooltip, closeTooltip, tooltip }}>
      {children}
    </TooltipContext.Provider>
  );
};

export const useTooltip = () => useContext(TooltipContext);

const Tooltip = ({ id, children }) => {
  const { openTooltip, closeTooltip, tooltip } = useTooltip();

  const handleOpenTooltip = () => {
    openTooltip(id);
  };

  const handleCloseTooltip = () => {
    closeTooltip(id);
  };

  useEffect(() => {
    if (tooltip !== id) {
      closeTooltip(id);
    }
  }, [tooltip, id, closeTooltip]);

  return (
    <div
      onMouseEnter={handleOpenTooltip}
      onMouseLeave={handleCloseTooltip}
      onFocus={handleOpenTooltip}
      onBlur={handleCloseTooltip}
    >
      {children}
      {tooltip === id && <div>Tooltip content</div>}
    </div>
  );
};

export default Tooltip;
```

