## I18n Violations in a Library Platform

### 1. Hardcoded Text in JavaScript

**Violation:**
```javascript
function displayBookDetails(book) {
  alert(`You have borrowed the book "${book.title}" by ${book.author}.`);
}
```

**Explanation:** The text within the alert is hardcoded in English. If the platform needs to support other languages, this code will not work as expected.

**Inconsistent File Structure Issue:**
```javascript
// en.js
export default {
  bookBorrowed: 'You have borrowed the book "%s" by %s.',
};

// fr.js
export default {
  bookBorrowed: 'Vous avez emprunté le livre "%s" de %s.',
};
```

**Advice to Fix:**
```javascript
import { getTranslation } from './translations';

function displayBookDetails(book) {
  const t = getTranslation();
  alert(t('bookBorrowed', book.title, book.author));
}
```

**Explanation:** By using a translation function, the text can be easily swapped out based on the user's language preference. The translations are stored in a separate file, allowing for easy maintenance and updates.

**Best Practices:**
- Use a consistent naming convention for translation keys (e.g., `bookBorrowed`).
- Keep translations in a separate file or module to maintain a clear separation of concerns.
- Use a translation function that accepts the language code as an argument to enable dynamic language switching.

